import React, { Component } from "react";

import "./header.css";
import logo from "./logo_transparent.png";

class AppHeader extends Component {
  render() {
    return (
      <header>
        <div id="logo">
          <img src="{logo}" />
        </div>
        <div id="post_job">
          <button type="button" name="button">
            Post a Job
          </button>
        </div>
      </header>
    );
  }
}

export default AppHeader;
